                <NextButton />
                <p className='step-text'>Continuing with Email, you agree to the<span className='step-text__color'>Terms of Use</span>  and <span className='step-text__color' >Privacy Policy</span>.</p>
                
            </div>
    );
}

export default StepEmail;
